const DmMono300 = `@font-face { font-family: 'DM Mono'; font-style: normal; font-weight: 300; src: local('DM Mono Light'), local('DMMono-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const DmMonoRegular = `@font-face { font-family: 'DM Mono'; font-style: normal; font-weight: 400; src: local('DM Mono Regular'), local('DMMono-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const DmMono300italic = `@font-face { font-family: 'DM Mono'; font-style: italic; font-weight: 300; src: local('DM Mono Light Italic'), local('DMMono-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const DmMonoItalic = `@font-face { font-family: 'DM Mono'; font-style: italic; font-weight: 400; src: local('DM Mono Italic'), local('DMMono-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
